    { name = "mashumaro" },
    { name = "orjson" },
]

[package.dev-dependencies]
dev = [
    { name = "covdefaults" },
    { name = "mypy" },
    { name = "pre-commit" },
    { name = "pylint" },
    { name = "pylint-per-file-ignores" },
    { name = "pytest" },
    { name = "pytest-cov" },
    { name = "syrupy" },
]

[package.metadata]
requires-dist = [
    { name = "mashumaro", specifier = "~=3.13" },
    { name = "orjson", specifier = ">=3.10.7" },
]

[package.metadata.requires-dev]
dev = [
    { name = "covdefaults", specifier = ">=2.3.0" },
    { name = "mypy", specifier = "==1.18.2" },
    { name = "pre-commit", specifier = "==4.5.0" },
    { name = "pylint", specifier = "==4.0.3" },
    { name = "pylint-per-file-ignores", specifier = ">=1.3.2" },
    { name = "pytest", specifier = "==9.0.1" },
    { name = "pytest-cov", specifier = "==7.0.0" },
    { name = "syrupy", specifier = ">=4.7.1" },
]
